VALUES ('5011007008345', 'Redbreast', 'TASTING NOTES NOSE: A COMPLEX, piy AND FRUITY Aroma WITH TOASTED WOOD NOTES EVIDENT. TASTE: FULL FLAVOURED AND COMPLEX; A Harmonious BALANCE OF piy CREAMY, FRUITY, SHERRY AND TOASTED NOTES. FINISH:atiyingy ong. THE COMPLEX FLAVOURS LINGER ON THE PALATE. SINGLE POT STILL IRISH WHISKEY Single Pot Still Irish Whiskey is unique to Ireland. It is regarded as the quintessential style of Irish whiskey, safeguarded and nurtured under the watchful eye of the Midleton Distillery for almost two hundred years. Single Pot Still Irish Whiskey is made from a mash of malted and unmalted barley and then triple distilled in traditional copper pot stills. Pot Still Irish whiskeys are characterised by full, complex flavours and a wonderful, creamy mouthfeel. POT This mark arlifies this wheskey as from the renowned Midleton Distillry Ptill lahiskey County Cork Iredand 00ml', '', '', '', '', '', '', '', '', '', '', '1');

